import React from 'react';
import './App.css';

function Creategame() {
  return (
    <div>
        <h1>Create game</h1>
        <p font="16" >Please Choose A or B or C or D to be answer (4character ) </p>
        <p class="answer" font="16">Answer: </p>
        <p class="remainchar" font="16">Character(s)remaining: </p>
        <p class="countfail" font="16">Fail: </p>    
        <p class="Choose" font="16" style={{display :"inline-block"}}>Choose: </p>
        <button>A</button>
        <button>B</button> 
        <button>C</button> 
        <button>D</button> 
        </div>
  );
}

export default Creategame;
